import "../style/App.css";
import Nav from './Nav';
import { BrowserRouter, Routes, Route } from 'react-router-dom';
import Header from "./Header";
import Footer from './Footer';
import Apropos from "./Apropos";


function App(){
  return(
    <div className='App'>
      <BrowserRouter>
        <Nav />
        <Routes>
          <Route path="/" element={<Header />} />
        </Routes>
        <main/>
        <Footer/>
      </BrowserRouter>
    </div>
  );
}

export default App;
